CREATE TABLE pokemon (
    id INT PRIMARY KEY,
    name VARCHAR(50) NOT NULL,
    order_ INT,
    height INT,
    weight INT,
    base_experience INT,
    is_default BOOLEAN,
    pokemon_species_id INT,
    FOREIGN KEY (pokemon_species_id) REFERENCES pokemon_species(id) ON DELETE RESTRICT ON UPDATE CASCADE
);


